import { Item } from "./Item";

function ListItems(props){

    const {list, onClick} = props;

    list.map(function(newItem){
        return(
            <Item key = {newItem.id} id = {newItem.id} itemInfo = {newItem} onClick = {onClick}></Item>
        )
    })

}
export {ListItems}
